meta.dataGenCode:


$Candles {
    name=Ape Tether US Binance | data=@(APEUSDT, 1h, 4200)
}
+ Spline {name=EMA, 10 | data= (async () => {
    let e = await ema(close, 100) 
    return iter((i) => {
        let color = close[i] > e[i - 100] ? '#41a376' : '#de4646'    
        return [open[i], high[i], low[i], close[i], volume[i], color]
    })
})()     
};
